import { useState } from "react";
// Desc: Contact us page
function App() {
    const [activeCity, setActiveCity] = useState(null);

    const cities = [
      { name: 'Sydney', adress : "123 Sample St, Sydney NSW 2000 AU", id: 1 },
      { name: 'Tokyo', adress : "123 Sample St, Sydney NSW 2000 AU", id: 2 },
      { name: 'Paris', adress : "123 Sample St, Sydney NSW 2000 AU", id: 3 },
      { name: 'Aydin', adress : "123 Sample St, Sydney NSW 2000 AU", id: 4 },
      { name: 'Aydin', adress : "123 Sample St, Sydney NSW 2000 AU", id: 5 },
      { name: 'Aydin', adress : "123 Sample St, Sydney NSW 2000 AU", id: 5 },
      { name: 'Aydin', adress : "123 Sample St, Sydney NSW 2000 AU", id: 5 },
      { name: 'Aydin', adress : "123 Sample St, Sydney NSW 2000 AU", id: 5 },
      
    ];
  
    const handleCityClick = (id) => {
      setActiveCity(id);
    };
    return (
        <div className="App w-[100vw] h-[100vh] flex  gap-[1vh] justify-center  overflow-y-auto ">
           <div className="w-[80vw] h-[45vw]  flex flex-col gap-[0.5vw] ">
                <p className="contacttag">Tagline</p>
                <p className="contactlocation">Locations</p>
                <p className="contactdesc">Lorem ipsum dolor sit amet, consectetur adipiscing elit. </p>
                <div className="w-full h-[30vw]  flex">
                    <div className="w-1/2 h-full  flex flex-col relative  overflow-auto">

                    {cities.map((city) => (
                    <div
                        key={city.id}
                        onClick={() => handleCityClick(city.id)}
                        
                    >
                            <div  className={activeCity === city.id ? 'w-full h-[7vw]  flex justify-end items-center active' : 'w-full h-[7vw]  flex justify-end items-center'}>
                            <div className="w-[97.5%] h-full  flex flex-col">
                                <div className="w-full h-1/3  locationheader flex items-center" >{city.name}</div>
                                <div className="w-full h-1/3  locationinfo flex items-center">{city.adress}</div>
                                <div className="w-full h-1/3  viewmap flex items-end">View Map</div>
                            </div>
                        </div>
                        </div>
                        ))}


                    </div>
                    <div className="w-1/2 h-full bordertest"></div>
                </div>
            </div>
      </div>
    );
  }
  
export default App;
